import React from 'react'
import { useHistory } from "react-router-dom"
const Header = () => {
    let history = useHistory()
    const handleAddJob = () => {
        history.push(`/add-job`)
    };
    return (
        <>
            <h1 className="text-center">Product Roles </h1> 
            <button onClick={(e)=> handleAddJob(e)} className="pull-right btn btn-warning ">Post a job</button> 
        </>
    )
}

export default Header;
